export const ProductList = () => {


  const renderItem = (item: any) => {
    return <div>
      {item.name}
    </div>
  }

  const { state: { items } } = useContext<any>(MainContext);
  console.log('items', items)
  return (
    <div className="product-list">
      {
        items.map((item: any) => {
          renderItem(item)
        })
      }
    </div>
  )
}
